import React, { useEffect } from "react";
import { NavLink } from "react-router-dom";
import s from './Header.module.css';
import User from '../../assets/images/user.png'

const Header = (props) => {
    useEffect(Header, [props.myProfile])
    return (
        <header className={s.header}>
            <img src='https://fv2-5.failiem.lv/thumb_show.php?i=26pk8r8nq&view'></img>
            <div className={s.loginBlock}>
                {props.isAuth ? (<div>{props.myProfile.photos.small ? props.myProfile.photos.small : User} - <button onClick={props.logout}>Log out</button></div>) : <NavLink to={'/login'}>Login</NavLink>}
            </div>
        </header>
    )  
};

export default Header;
